import React from "react";
import {NavLink} from "react-router-dom";

const Header =()=> {
    return (
        <div>
            <NavLink to='/'>Дом</NavLink>
            <NavLink to='/product'>Каталог</NavLink>
            <NavLink to='/cart'>Корзина</NavLink>
        </div>
    )
}

export default Header;
